import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { Grommet } from "grommet";
//import reportWebVitals from "./reportWebVitals";

ReactDOM.render(
  <Grommet plain>
    <App />
  </Grommet>,
  document.getElementById("root")
);

